import './personalProjectsCSS.css'
import PersonalProjectsModel from '../model/personalProjects'
import {useState, useEffect} from 'react'

function PersonalProjects() {

    const [personalProjects, setPersonalProjects] = useState(null)

    function addPersonalProject() {
        setPersonalProjects([...personalProjects, {
            "title": "",
            "startDateMonth": "",
            "startDateYear": "",
            "endDateMonth": "",
            "endDateYear": "",
            "currentProject": "",
            "projectDescription": "",
            "githubLink": "",
            "new": true
        }])

        console.log("add personal projects plus clicked")
    }

    useEffect(() => {
        console.log('in use effect')
            const getPersonalProjects = async() => {
                console.log('in function')
                let personalProjectsModel = new PersonalProjectsModel()

                try {
                    // let educationModel = new EducationModel()
                    let personalProjects = await personalProjectsModel.getPersonalProjects()
                    console.log('here')
                    console.log(`personalProjects ${personalProjects[0].title}`)
                    setPersonalProjects(personalProjects)
                }
                catch (error) {
                    console.log('here2');
                    setPersonalProjects(null)
                }
            }
            getPersonalProjects();


    }, [])


    return (
        <div class='container'>
        <form>
            <div class='personalProjects-border'>
                <h1 class='personalProjects'>Personal Projects</h1>
                <hr></hr>

                {personalProjects != null ? personalProjects.map((personalProject, index) => (

                    <div class = 'personalProjectsFormGroup'>
                        <div class='form-group'>
                            <label>Title</label>
                            <input style = {{width: `${personalProject.title.length > 0 ? personalProject.title.length : 40}ch`}} type="text" placeholder={personalProjects == null ? 'Title' : null} value = {personalProjects != null ? personalProject.title : null}/>
                        </div>

                        {/* change to date picker */}
                        <div class='form-group'>
                            <label>Start Date</label>
                            <input style = {{width: `${personalProject.startDateMonth.length + personalProject.startDateYear > 0 ? personalProject.startDateMonth.length + personalProject.startDateYear.length: 30}ch`}} type="text" placeholder={personalProjects == null ? 'Start Date' : null} value = {personalProjects != null ? `${personalProject.startDateMonth} ${personalProject.startDateYear}` : null}/>
                        </div>



                        {personalProject.new == true && personalProject.new != null ? (
                                <div class='form-group'>
                                    <label>Current Project</label>
                                    <input type="checkbox"/>
                                </div>
                            ) : null}

                        {personalProject.currentProject == 1 ? (
                            <div class='form-group'>
                                <label>Currently Project</label>
                                <input checked = {personalProject.currentProject} type="checkbox"/>
                            </div>
                        ) : (
                            <div class='form-group'>
                                <label>End Date</label>
                                <input style = {{width: `${personalProject.endDateMonth.length + personalProject.endDateYear.length > 0 ? personalProject.endDateMonth.length + personalProject.endDateYear.length : 30}ch`}} type="text" placeholder={personalProjects == null ? 'End Date' : null} value = {personalProjects != null ? `${personalProject.endDateMonth} ${personalProject.endDateYear}` : null}/>
                            </div>
                        )}




                        <div class='form-group'>
                            <label>Project Description</label>
                            <input style = {{width: `${personalProject.projectDescription.length > 0 ? personalProject.projectDescription.length : 30}ch`}} type="textarea" placeholder={personalProjects == null ? 'Project Description' : null} value = {personalProjects != null ? personalProject.projectDescription : null}/>
                        </div>

                        <div class='form-group'>
                            <label>Github Link</label>
                            <input style = {{width: `${personalProject.githubLink.length > 0 ? personalProject.githubLink.length : 40}ch`}} type="text" placeholder={personalProjects == null ? 'Github Link' : null} value = {personalProjects != null ? personalProject.githubLink : null}/>
                        </div>
                    </div>
                )): null}


                <h1 id='plus' onClick={()=>addPersonalProject()}>+</h1>


            </div>
        </form>

    </div>
    )
}

export default PersonalProjects;
